Alpine.data("etapasObra",()=>({tab:1,closeModal(a){a().inputsEtapa.nome=null,a().inputsEtapa.porc_etapa=0,a().inputsEtapa.porc_geral=0,a().inputsEtapa.concluida=!1,a().inputsEtapa.dt_inicio=null,a().inputsEtapa.dt_previsao=0,a().inputsEtapa.dt_termino=0,a().inputsEtapa.dt_vencimento=!1,a().inputsEtapa.quitada=!1,a().inputsEtapa.descricao_completa=!1,a().etapaIdEdit=!1,a().modal=!1},setEdit(a,t){t().inputsEtapa.nome=a.nome,t().inputsEtapa.porc_etapa=a.porc_etapa,t().inputsEtapa.porc_geral=a.porc_geral,t().inputsEtapa.concluida=a.concluida,t().inputsEtapa.dt_inicio=a.dt_inicio,t().inputsEtapa.dt_previsao=a.dt_previsao,t().inputsEtapa.dt_termino=a.dt_termino,t().inputsEtapa.dt_vencimento=a.dt_vencimento,t().inputsEtapa.quitada=a.quitada,t().inputsEtapa.descricao_completa=a.descricao_completa,t().etapaIdEdit=a.id,t().modal=!0},excluirEtapa(a,t){this.$store.dialog.show("Excluir etapa","Realmente deseja excluir a etapa?",{cancel:{},confirm:{text:"Sim, excluir!",action:()=>t().delEtapa(a)}})}}));
